function About() {
    return(
<div className="App">
<header className="App-header">
        <section class="page-section bg-primary" id="vision">
            <div class="container px-4 px-lg-5">
                <div class="row gx-4 gx-lg-5 justify-content-center">
                    <div class="col-9 text-center">
                        <h2 class="text-white mt-0">회사 소개 페이지임</h2>
                        <p class="text-white-75 mb-4">우리들의 주변인들이 안전하게 외출할 수 있도록 주변에 위험요소들은 피할 수 있도록, 대중교통을 이용하실수 있도록</p>
                        <a class="btn btn-light btn-xl" href="#vision">더 자세한 정보 확인하기</a>
                    </div>
                </div>
            </div>
        </section>
    </header>
</div>
    );
};

export default About;
